import { Routes, Route } from "react-router-dom";
import Home from "./routes/Home";
import {Orders , OrderDetails} from "./routes/RecursiveComponent";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path='/orders/:id'> 
          <OrderDetails />
        </Route>
        <Route path='/orders'>
          <Orders />
        </Route>
      </Routes>
    </div>
  );
}

export default App;
